import './index.scss';
import './styles/media.scss'
import './styles/utility.scss'
import './styles/normalize.scss'

function App() {
  return (
   <header className='header container'>
      <div className="header__left">
        <div className="header__logo"><svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" class="w-10 h-10 text-white p-2 bg-indigo-500 rounded-full cursor-pointer" viewBox="0 0 24 24">
            <path d="M6 3c1 0 3 .6 3 3S7 9 6 9h12M6 3h12c1 0 3 .6 3 3s-2 3-3 3M6 3c-1 0-3 .6-3 3v13.002C3 20.106 3.895 21 5 21h5.5M18 9v1M7 13h3m-3 4h3m4 2v-3m2 0h1.5a1.5 1.5 0 0 0 1.5-1.5v0a1.5 1.5 0 0 0-1.5-1.5H14v3m2 0 3 3m-3-3h-2m7 5-2-2m0 0 2-2m-2 2-2 2">
            </path>
          </svg></div>
        <nav className="header__nav"></nav>
      </div>
      <div className="header__right">
        <div className="header__search"></div>
        <div className="header__profile"></div>
      </div>
   </header>
  );
}

export default App;
